strList = inputRaw.splitlines()

xmasCount = 0
# loop through chars, starting with X and testing each direction
numCols = len(strList[0])
numRows = len(strList)
for rowIdx in range(numRows):
    for colIdx in range(numCols):
        if strList[rowIdx][colIdx] == 'X':
            # test N
            if rowIdx >= 3:
                if strList[rowIdx-1][colIdx] == 'M' and strList[rowIdx-2][colIdx] == 'A' and strList[rowIdx-3][colIdx] == 'S':
                    xmasCount += 1
            # test NE
            if rowIdx >= 3 and (colIdx + 3) < numCols:
                if strList[rowIdx-1][colIdx+1] == 'M' and strList[rowIdx-2][colIdx+2] == 'A' and strList[rowIdx-3][colIdx+3] == 'S':
                    xmasCount += 1
            # test E
            if (colIdx + 3) < numCols:
                if strList[rowIdx][colIdx+1] == 'M' and strList[rowIdx][colIdx+2] == 'A' and strList[rowIdx][colIdx+3] == 'S':
                    xmasCount += 1
            # test SE
            if (rowIdx + 3) < numRows and (colIdx + 3) < numCols:
                if strList[rowIdx+1][colIdx+1] == 'M' and strList[rowIdx+2][colIdx+2] == 'A' and strList[rowIdx+3][colIdx+3] == 'S':
                    xmasCount += 1
            # test S
            if (rowIdx + 3) < numRows:
                if strList[rowIdx+1][colIdx] == 'M' and strList[rowIdx+2][colIdx] == 'A' and strList[rowIdx+3][colIdx] == 'S':
                    xmasCount += 1
            # test SW
            if (rowIdx + 3) < numRows and colIdx >= 3:
                if strList[rowIdx+1][colIdx-1] == 'M' and strList[rowIdx+2][colIdx-2] == 'A' and strList[rowIdx+3][colIdx-3] == 'S':
                    xmasCount += 1
            # test W
            if colIdx >= 3:
                if strList[rowIdx][colIdx-1] == 'M' and strList[rowIdx][colIdx-2] == 'A' and strList[rowIdx][colIdx-3] == 'S':
                    xmasCount += 1
            # test NW
            if rowIdx >= 3 and colIdx >= 3:
                if strList[rowIdx-1][colIdx-1] == 'M' and strList[rowIdx-2][colIdx-2] == 'A' and strList[rowIdx-3][colIdx-3] == 'S':
                    xmasCount += 1

print(xmasCount)